CREATE TABLE IF NOT EXISTS "accidente_accidente" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "fecha" date NOT NULL, "sexo_victima" varchar(1) NULL, "edad_victima" smallint unsigned NOT NULL CHECK ("edad_victima" >= 0), "cantidad_victima" smallint unsigned NOT NULL CHECK ("cantidad_victima" >= 0), "usuario_id" bigint NOT NULL REFERENCES "autenticacion_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "condicion_victima_id" bigint NULL REFERENCES "accidente_condicionvictima" ("id") DEFERRABLE INITIALLY DEFERRED, "gravedad_victima_id" bigint NOT NULL REFERENCES "accidente_gravedadvictima" ("id") DEFERRABLE INITIALLY DEFERRED, "tipo_accidente_id" bigint NOT NULL REFERENCES "accidente_tipoaccidente" ("id") DEFERRABLE INITIALLY DEFERRED, "ubicacion_id" bigint NOT NULL REFERENCES "accidente_ubicacion" ("id") DEFERRABLE INITIALLY DEFERRED);
