CREATE TABLE IF NOT EXISTS "accidente_ubicacion" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "latitud" decimal NULL, "longitud" decimal NULL, "complemento" varchar(256) NULL, "barrio_id" bigint NULL REFERENCES "accidente_barrio" ("id") DEFERRABLE INITIALLY DEFERRED, "primer_via_id" bigint NOT NULL REFERENCES "accidente_via" ("id") DEFERRABLE INITIALLY DEFERRED, "segunda_via_id" bigint NULL REFERENCES "accidente_via" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_ubicacion" UNIQUE ("primer_via_id", "segunda_via_id", "latitud", "longitud", "complemento", "barrio_id"));
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "autenticacion_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
